import React, { Component } from 'react';
import './header.css';
import { Link } from 'react-router-dom';
//import svg from '../../../public/1.svg'

class Header extends Component {


render(){

  return(
    <nav className = "nav">
      <Link to={'/'}>
        <img className = "logo"src="./1.svg"/>
      </Link>
      <Link to={'/about'}> About </Link>

    </nav>
  )
}

}

export default Header;
